import React, { Component } from 'react';
import { Container, Row, Table } from 'react-bootstrap';
import { withRouter } from 'react-router-dom';
import axios from 'axios';
import NavBar from './NavBar'

class OrderList extends Component {

  constructor() {
    super();
    this.orders = []

    var url = "http://localhost:3000/ordersByStatus/closed";

    axios.get(url)
    .then(response => {
        if(response.status === 200){
            this.orders = response.data;
            console.log(this.orders)
        }
    })
    .catch(error => {
        console.log(error);
    })

  }

  render() {
    return (
      <div>
        <NavBar/>

        <Container>
          <Row>
            <Table responsive>
              <thead>
                <tr>
                  <th>#</th>
                  <th>Table heading</th>
                  <th>Table heading</th>
                </tr>
              </thead>
              <tbody>
                <tr>
                  <td>1</td>
                  <td>Table cell</td>
                  <td>Table cell</td>
                </tr>
                <tr>
                  <td>2</td>
                  <td>Table cell</td>
                  <td>Table cell</td>
                </tr>
                <tr>
                  <td>3</td>
                  <td>Table cell</td>
                  <td>Table cell</td>
                </tr>
              </tbody>
            </Table>
          </Row>
        </Container>

      </div>
    );
  }
}

export default withRouter(OrderList);
